{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/pinoliar/which-uh-m-noa-majors-are-worth-it?scriptVersionId=94629925\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown","outputs":[],"execution_count":0},{"cell_type":"markdown","id":"5189a62a","metadata":{"papermill":{"duration":0.039482,"end_time":"2022-05-03T06:47:26.834917","exception":false,"start_time":"2022-05-03T06:47:26.795435","status":"completed"},"tags":[]},"source":["**Introduction:**  \n","The University of Hawaiʻi at Mānoa (UH Mānoa) is the largest institution of higher learning in Hawaiʻi. Its most recent semester, Spring 2022, had a student population of 17,579 (Headcount Enrollment Overview). It has conferred about 4,600 degrees each year, of which 3,200 were Bachelor's degrees for the past five years (Degrees and Certificates Awarded). Its most recent year, 2020-21, it conferred 4,461 degrees, of which 3,200 were Bachelor's degrees (Degrees and Certificates Awarded). A bachelor's degree is a great investment for the future, but is this true for all? This study tries to answer this by collecting and analyzing data.\n"]},{"cell_type":"markdown","id":"2239262a","metadata":{"papermill":{"duration":0.039441,"end_time":"2022-05-03T06:47:26.913332","exception":false,"start_time":"2022-05-03T06:47:26.873891","status":"completed"},"tags":[]},"source":["**Methodology:**  \n","The study is a quantitative inquiry that investigates which majors are worth it. It is observational and descriptive. It simply takes data collected by the data source, Payscale, on different majors about the pay rate in the early- and mid-careers and meaning from graduates of schools in the United States who work in the United States. It then describes that data systematically using mean and median. The study uses secondary data, data that has already been collected. Payscale, is a consulting research company. It has almost eighteen years' experience in studying compensation across different majors. The company maintains a database of information on how much employers pay their employees. The website is essential to employers as it provides the latest insights on employee worth and appropriate compensation. The subject study thus collects the latest data from this website into a CSV file with added rows for the mean and median of all majors. It retrieves information on majors, their early-career pay (between 0-5 years experience), and mid-career pay (after ten or more years experience). The study also uses a \"meaning\" value: the percentage of graduates who believe their work makes the world better.  \n","The study then uses the information and customizes it to only include majors offered at the University of Hawaiʻi at Mānoa (UH Mānoa). It seeks to understand which ones are worth it.\n"]},{"cell_type":"markdown","id":"a9a5b35d","metadata":{"papermill":{"duration":0.036824,"end_time":"2022-05-03T06:47:26.986311","exception":false,"start_time":"2022-05-03T06:47:26.949487","status":"completed"},"tags":[]},"source":["**Research Question:**  \n","Which University of Hawaiʻi at Mānoa (UH Mānoa) undergraduate majors are worth it?"]},{"cell_type":"markdown","id":"b7b7f192","metadata":{"papermill":{"duration":0.036507,"end_time":"2022-05-03T06:47:27.059138","exception":false,"start_time":"2022-05-03T06:47:27.022631","status":"completed"},"tags":[]},"source":["**Variables & Metrics:**  \n","The subject study involves empirical observation and measurement. The aim is to quantify the correlation between one variable and the other. The underlying assumption is that some college majors are worth it while others are not. Some have a high prospect of high earnings in the short-term and long-term. It, therefore, is quantitatively accurate as it does not use human judgment. Unlike qualitative studies, quantitative research employs statistics to develop mathematical models and predictions.  \n","The variables are the demographics of income that individuals with different degrees and majors get. These are the variables that PayScale provides. They are available on the website for free. The study uses the variables individually and groups them for practical analysis. Typically, quantitative studies involve no independent or dependent variables. In this case, the study is descriptive. There is no cause-effect. The metrics are the general variance in salaries of individual majors, mean of subjects, and faculties. Since there are no dependent or independent variables, the study only examines how college majors influence salaries.\n"]},{"cell_type":"code","execution_count":1,"id":"adffef42","metadata":{"execution":{"iopub.execute_input":"2022-05-03T06:47:27.138168Z","iopub.status.busy":"2022-05-03T06:47:27.135172Z","iopub.status.idle":"2022-05-03T06:47:28.38969Z","shell.execute_reply":"2022-05-03T06:47:28.388266Z"},"papermill":{"duration":1.294955,"end_time":"2022-05-03T06:47:28.389861","exception":false,"start_time":"2022-05-03T06:47:27.094906","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["── \u001b[1mAttaching packages\u001b[22m ─────────────────────────────────────── tidyverse 1.3.1 ──\n","\n","\u001b[32m✔\u001b[39m \u001b[34mggplot2\u001b[39m 3.3.5     \u001b[32m✔\u001b[39m \u001b[34mpurrr  \u001b[39m 0.3.4\n","\u001b[32m✔\u001b[39m \u001b[34mtibble \u001b[39m 3.1.5     \u001b[32m✔\u001b[39m \u001b[34mdplyr  \u001b[39m 1.0.7\n","\u001b[32m✔\u001b[39m \u001b[34mtidyr  \u001b[39m 1.1.4     \u001b[32m✔\u001b[39m \u001b[34mstringr\u001b[39m 1.4.0\n","\u001b[32m✔\u001b[39m \u001b[34mreadr  \u001b[39m 2.0.2     \u001b[32m✔\u001b[39m \u001b[34mforcats\u001b[39m 0.5.1\n","\n","── \u001b[1mConflicts\u001b[22m ────────────────────────────────────────── tidyverse_conflicts() ──\n","\u001b[31m✖\u001b[39m \u001b[34mdplyr\u001b[39m::\u001b[32mfilter()\u001b[39m masks \u001b[34mstats\u001b[39m::filter()\n"