33.563923Z","iopub.status.idle":"2022-05-03T06:47:33.580577Z","shell.execute_reply":"2022-05-03T06:47:33.578835Z"},"papermill":{"duration":0.151354,"end_time":"2022-05-03T06:47:33.580724","exception":false,"start_time":"2022-05-03T06:47:33.42937","status":"completed"},"tags":[]},"outputs":[{"name":"stdout","output_type":"stream","text":["\f"]}],"source":["# Clear console\n","cat(\"\\014\")"]},{"cell_type":"markdown","id":"567b4abc","metadata":{"papermill":{"duration":0.1277,"end_time":"2022-05-03T06:47:33.834445","exception":false,"start_time":"2022-05-03T06:47:33.706745","status":"completed"},"tags":[]},"source":["**Analysis:**  \n","The subject study includes ninety-two Bachelor's degree majors that the University of Hawaiʻi at Mānoa (UH Mānoa) offers. The majors fall into different subjects: Humanities, education, engineering, science, technology, math, social science, business, medicine, and architecture. They stretch across twelve faculties that include:  \n","CALL: College of Arts, Languages & Letters  \n","COED: College of Education  \n","COE: College of Engineering  \n","CNS: College of Natural Sciences  \n","CSS: College of Social Sciences  \n","CTAHR: College of Tropical Agriculture and Human Resources  \n","JABSOM: John A. Burns School of Medicine  \n","SOA: School of Architecture  \n","NAWSON: Nancy Atmospera-Walch School of Nursing  \n","SOEST: School of Ocean and Earth Science and Technology  \n","Shidler: Shidler College of Business  \n","Thompson: Thompson School of Social Work and Public Health.  \n","The CSV file is read for interpretation. The data is then analyzed using descriptive statistical methods. First, the analysis arranges the data based on the early-career and mid-career pay. It then tables the results in descending order. The first analysis is that of subjects, faculties, and corresponding mean or median pay. This calculation involves grouping the majors into respective subjects and faculties, the sum of the total pay, and dividing it by the number of terms.  \n","The plots show that majors in the College of Engineering (COE) had the highest early-career and mid-career mean salaries. Colleges of Nursing, Natural Sciences, Medicine, Business, and Ocean and Earth Sciences and Technology follow each other, respectively, with a mean of >52,405 in early-career salaries. Social science, science, architecture, humanities, social work, and education majors have the lowest consecutive early-career pay mean of <52,405. In mid-career pay, math, business, social sciences, and architecture overtakes medicine. Social work and education remain the lowest mid-career mean salaries. Business majors maintain their fifth position in early- and mid-career mean salaries.  \n","School of Architecture has the fourth-lowest early-career means to pay. However, in the mid-career mean pay, it is the fourth highest. The median central measures show engineering and technology majors maintaining their first and second positions. Medicine, math, and business majors follow consecutively. Science, social science, architecture, humanities, social work, and education have the lowest median of ≤48,650. However, the median mid-career pay for medicine, nursing, and related majors stagnates. Architecture and business majors double their median pay and overtake them.  \n","In terms of individual majors, the computer engineering major has the highest early-career pay, with a 79,000 pay. Electrical engineering, computer science, aerospace engineering, and dental hygiene follow. Early childhood education has the lowest early-career pay.  \n","In terms of mid-career pay, information & computer sciences have the highest pay. Computer engineering came second, followed by electrical engineering, aerospace engineering, and astronomy. Early childhood education has the lowest mid-career pay at 45,400.  \n","In terms of meaning, human nutrition had the highest rating at 85%. Nursing, medical technology, dental hygiene, and early childhood education followed. Fashion design was the major with the lowest meaning.\n","\n","\n","\n"]},{"cell_type":"markdown","id":"bd26297a","metadata":{"papermill":{"duration":0.127742,"end_time":"2022-05-03T06:47:34.09208","exception":false,"start_time":"2022-05-03T06:47:33.964338","status":"completed"},"tags":[]},"source":["**Conclusion:**  \n","The subject inquiry aimed to investigate which majors the University of Hawaiʻi (UH Mānoa) offers are worth it. The analysis used the measure of central tendency to summarize the data. The metrics are the mean and median of early- and mid-career pay and meaning. The analysis shows that STEM majors have the highest pay. They dominate the top-ten highest across pay metrics. Their average salaries also double within five years. Other competitive majors are those in medicine and business. They are worth it and should be the priority. Yet, the growth of medicine majors' pay is slow. A major in architecture doubles their salary in ten years. A holder will earn more than medicine, nursing, and medical technology majors. The case is the same for business majors. These majors can be better choices than medicine. Education, humanities, and social work should be the last choice. A graduate with one of these majors and ten years' experience is likely to earn less than a newly graduated computer science graduate.  \n","The most significant shift in the analysis appears in ranking majors on meaning. Early childhood education is ironically among the top-five majors with the highest meaning. Despite being the lowest early- and mid-career pay, those with this degree believe this major makes the world a better place. Meaning early childhood graduates are likely to be more satisfied than computer engineering graduates and information & computer sciences graduates. Even so, pay is still a significant factor. Anyone choosing majors in education, social work, or humanities should think it through carefully.  \n","It is worth noting that this study grouped data into subjects and colleges. This approach is statistically appropriate. Yet, there are few cases of skewed data points in the real world. For instance: a graduate in Asian Studies, Japanese, Chinese, or Philosophy, all of which are humanities, places in the top 30 in mid-career pay at 13, 17, 26, and 30 with pays of 115,100, 110,300, 99,600, and 94,300 respectively. Further studies should consider this limitation.\n"]},{"cell_type":"markdown","id":"c521389a","metadata":{"papermill":{"duration":0.12629,"end_time":"2022-05-03T06:47:34.344339","exception":false,"start_time":"2022-05-03T06:47:34.218049","status":"completed"},"tags":[]},"source":["**Works Cited**  \n","“Headcount Enrollment Overview.” IRAPO - MAPS, https://data.hawaii.edu/#/reports/ENRT01.  \n","“Degrees and Certificates Awarded.” IRAPO - MAPS, https://data.hawaii.edu/#/reports/MAPS_DEG_TOC?FISCAL_YEAR=2021&IRO_INSTITUTION=MAN.  \n","  “The Highest-Paying Careers with a Bachelor's Degree.” Payscale - Highest Paying Jobs With a Bachelor’s Degree, https://www.payscale.com/college-salary-report/majors-that-pay-you-back/bachelors.\n"]}],"metadata":{"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":10.944488,"end_time":"2022-05-03T06:47:34.583487","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2022-05-03T06:47:23.638999","version":"2.3.3"}},"nbformat":4,"nbformat_minor":5}